  const [addPark, setAddPark] = useState({
    Park: '',
    Location: '',
    Category: '',
    Description: '',
    YearOpened: ''
  })

  const handleChange = (e) => {
    e.target.value
  }

  return (
    <div className="addPark">
      <h1>Add Park</h1>
      <form onSubmit={props.onSubmit}>
        <input
          type="text"
          name="Park"
          value={props.value}
          placeholder="Park Name"
          onChange={props.onChange}
        ></input>
        <input
          type="text"
          name="Location"
          value={props.value}
          placeholder="Location"
          onChange={props.onChange}
