        <input
          type="text"
          name="Description"
          value={props.value}
          placeholder="Description"
          onChange={props.onChange}
        ></input>
        <input
          type="text"
          name="Year Opened"
          value={props.value}
          placeholder="Year Opened"
          onChange={props.onChange}
        ></input>
        <button className="submitButton" text="Submit">
          Add Park
        </button>
      </form>
    </div>
  )
}
export default CreatePark
